import {Box} from '@material-ui/core';
// components
import ChatHeader from './ChatHeader';
import Messages from './Messages';
import { setUser } from '../../context/UserProvider';

const Chat = () => {
    return (
        // <p>Hello from Chat</p>
         <Box>
           <ChatHeader setUser={setUser}/>
           <Messages/>
         </Box>
    )
}

export default Chat;
